import React from "react"
import './symbols.css'
import './style.css'
import './Desktop.js'
import './desktop.css'

export default function Symbols(props) {
    return (
      <div id="each-icon">
            <div id="pic"
            style={{
              background: `url(${props.icon})`,
              backgroundSize: 'contain',
              backgroundRepeat: 'no-repeat'
            }}
            lockAspectRatio={true} 
            >
            <p id="icon-name">Instagram</p></div>
        <img id="icons-pic" draggable="true" src={props.icon} alt="imp"></img>
        <p id="icon-name">{props.title}</p>
      </div>
    )
}
